import React, {Component} from 'react';
import {MenuItem} from "./MenuItem";
import {Link} from "react-router-dom";
class Nav extends Component {
    render() {
        return (
            <div className='nav'>
                {MenuItem.map((item,index)=> {
                    return (

                            <Link  key={index} to={item.url}>
                                <li>
                                {item.title}
                                </li>
                            </Link>
                        )
                })}
            </div>
        );
    }
}

export default Nav;
